import React from 'react'

const FBShare = () => {
    return (
        <button className="button is-link"
            onClick={
                () => {
                    window.FBInstant.updateAsync({
                        action: 'CUSTOM',
                        image: 'data:image/png;base64,',
                        text: 'X just invaded Y\'s village!',
                        template: 'test_template',
                        data: { myReplayData: '...' },
                        strategy: 'IMMEDIATE',
                        notification: 'NO_PUSH',
                    }).then(
                        (data) => {
                            console.log('updateAsync() success!' + JSON.stringify(data));
                            window.FBInstant.quit();
                        },
                        error => {
                            console.error('updateAsync() ERROR! ' + JSON.stringify(error));
                        }
                    )
                }

            }>Share</button>
    )
}

export default FBShare
